import React from "react";
import { connect } from "react-redux";
import "./Buttons.css";
import { newGame } from "../actions";

const ButtonSet = props => {
  const elementsArray = Array.from(document.querySelectorAll(".input--player"));
  const playerNames = elementsArray.map(cur => cur.value);

  return (
    <button
      className="btn btn-set"
      onClick={() =>
        props.newGame({
          typedHouse: props.typedHouse,
          playerNames: playerNames
        })
      }
    >
      {props.btnName}
    </button>
  );
};

const mapStateToProps = state => {
  return { typedHouse: state.typedHouse };
};
const mapDispatchToProps = {
  newGame
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(ButtonSet);
